import React from "react";
import Title from "./Title";
import Img from "./Img";
import Gal1 from "../images/gal1.jpg";
import Gal2 from "../images/gal2.png";
import Gal3 from "../images/gal3.jpg";
import Gal4 from "../images/gal4.jpg";
import Gal5 from "../images/gal5.jpg";
import Gal6 from "../images/gal6.jpg";
import Gal7 from "../images/gal7.jpg";
import Gal8 from "../images/gal8.jpg";
import Gal9 from "../images/gal9.jpg";

function Gallery() {
    return(
        <div>
            <Title texto="GalerÃ­a" />
            <tabla className="tabla">
        <tr className="tr">
          <td>
            <Img className="img" src={Gal1} />
          </td>
          <td>
            <Img className="img" src={Gal2} />
          </td>
          <td>
            <Img className="img" src={Gal3} />
          </td>
        </tr>
        <br />
        <tr className="tr">
          <td>
            <Img className="img" src={Gal4} />
          </td>
          <td>
            <Img className="img" src={Gal5} />
          </td>
          <td>
            <Img className="img" src={Gal6} />
          </td>
        </tr>
        <br />
        <tr className="tr">
          <td>
            <Img className="img" src={Gal7} />
          </td>
          <td>
            <Img className="img" src={Gal8} />
          </td>
          <td>
            <Img className="img" src={Gal9} />
          </td>
        </tr>
      </tabla>
        </div>
    );
}

export default Gallery;
